import axios from "axios"

function MainFrame() {

    function handleSubmit(e) {

        e.preventDefault();

        var user_in = e.target[0].value

        if (user_in !== ""){

            var input = {data : user_in}

            console.log(

                fetch("http://127.0.0.1:5000/api/query", {

                    method: "POST",
                    crossorigin: true,
                    mode:'no-cors'
                })
                    .then((res) => res.json())    

                    .then((data) => {    

                        console.log(data);    
                    })    

                    .catch((error) => {    

                        console.error(error);    
                    }) 
                )
        }

    }

    return(

        <div className="MainFrame">

            <form onSubmit={handleSubmit}>
                <label>Hello there?</label>
                <input type="text" name="user_input" className="user_in"/>
                <input type="submit" name="user_input" className="user_in"/>
            </form>

        </div>
    )


}

export default MainFrame
